import {Link} from 'react-router-dom'

export default function EventPage() {
  return (
    <>
      <h1>EventPage</h1>
      <ul>
          <li><Link to='/event/eventDetail'>Event Detail Page</Link></li>
          <li><Link to='/event/newEvent'>New Event Page</Link></li>
          <li><Link to='/event/editEvent'>Edit Event Page</Link></li>
      </ul>
    </>
  )
}
